Well, an internal node stores pointers to its children (`node->nodes`, which maybe should be renamed for clarity). The id's are stored in the leaf nodes (`node->ids`). Thus, we need something like:

```
if (node->nodetype == RTREE_LEAF_NODE)
    add_answer(node->ids[i], ids, count);
else
    node_search(node->nodes[i], query, ids, count);
```

Here, we always directly return the ids from the root node, which is incorrect.
